import React, { useEffect, useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import AOS from 'aos'; // Import AOS for animations
import 'aos/dist/aos.css'; // Import AOS CSS
import carRental from '../../assets/car-rental.jpg';
import comfortableStays from '../../assets/comfortable-stays.jpg';
import dubaiBeauty from '../../assets/dubai-beauty.jpg';
import excitingAdventures from '../../assets/exciting-adventures.jpg';
import exploreGeorgia from '../../assets/explore-georgia.jpg';
import './Home.css';

const galleryImages = [
  { id: 1, src: exploreGeorgia, alt: 'Explore Georgia', className: 'large' },
  { id: 2, src: dubaiBeauty, alt: 'Beautiful Destinations', className: 'small' },
  { id: 3, src: comfortableStays, alt: 'Comfortable Stays', className: 'large' },
  { id: 4, src: excitingAdventures, alt: 'Exciting Adventures', className: 'medium' },
  { id: 5, src: carRental, alt: 'Car Rentals', className: 'small' },
];

const Home = () => {
  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  const [showMoreFAQ, setShowMoreFAQ] = useState(false);
  const [visibleAnswers, setVisibleAnswers] = useState([]);

  const faqQuestions = [
    { question: "What kind of clothes do I need to carry while traveling to Georgia?", answer: "You should carry clothes appropriate for the season..." },
    { question: "What is the best time to visit Georgia?", answer: "The best time to visit Georgia is between May and October..." },
    // More FAQs here...
  ];

  const toggleAnswer = (index) => {
    setVisibleAnswers((prev) => {
      const updated = [...prev];
      updated[index] = !updated[index];
      return updated;
    });
  };

  const toggleShowMoreFAQ = () => {
    setShowMoreFAQ(!showMoreFAQ);
  };

  return (
    <>
      <div className="content">
        {/* Carousel Section */}
        <div id="carouselExampleIndicators" className="carousel slide" data-bs-ride="carousel" data-bs-interval="2000">
          <div className="carousel-inner">
            <div className="carousel-item active" data-aos="fade-up">
              <img src={exploreGeorgia} className="d-block w-100" alt="Explore Georgia" />
            </div>
            <div className="carousel-item" data-aos="fade-up" data-aos-delay="200">
              <img src={dubaiBeauty} className="d-block w-100" alt="Beautiful Destinations" />
            </div>
            {/* Add other carousel items with AOS attributes */}
          </div>
        </div>

        {/* Gallery Section */}
        <section className="gallery py-5" data-aos="zoom-in">
          <div className="container">
            <h2 className="text-center mb-4" data-aos="fade-down">Top Tourism Places in Georgia</h2>
            <div className="gallery-grid">
              {galleryImages.map((image, index) => (
                <div 
                  className={`gallery-item ${image.className}`} 
                  key={image.id}
                  data-aos="flip-left"
                  data-aos-delay={index * 100} // Staggered animations
                >
                  <img src={image.src} alt={image.alt} className="img-fluid" />
                </div>
              ))}
            </div>
          </div>
        </section>

        {/* Service Features Section */}
        <section className="service-features py-5" data-aos="fade-up">
          <div className="container">
            <h2 className="text-center mb-4" data-aos="fade-down">Our Service Features</h2>
            <div className="row">
              <div className="col-md-4 text-center" data-aos="fade-right">
                <h4>Customized Tours</h4>
              </div>
              <div className="col-md-4 text-center" data-aos="fade-up" data-aos-delay="200">
                <h4>24/7 Support</h4>
              </div>
              <div className="col-md-4 text-center" data-aos="fade-left" data-aos-delay="400">
                <h4>Local Expertise</h4>
              </div>
            </div>
          </div>
        </section>

        {/* FAQ Section */}
        <section className="faq py-5" data-aos="fade-up">
          <div className="container">
            <h2 className="text-center mb-4">Frequently Asked Questions</h2>
            {/* FAQ Items */}
            <div className="accordion" id="faqAccordion">
              {faqQuestions.map((faq, index) => (
                <div className="accordion-item" key={index} data-aos="fade-up" data-aos-delay={index * 100}>
                  {/* Accordion logic here */}
                </div>
              ))}
            </div>
          </div>
        </section>
      </div>
    </>
  );
};

export default Home;
